    "#Does more activity lead to better sleep?\n",
    "\n",
    "# Calculate correlations\n",
    "cor_matrix <- cor(merged_data[, c(\"TotalSteps\", \"TotalMinutesAsleep\", \"SedentaryMinutes\")],\n",
    "                  use = \"complete.obs\")\n",
    "\n",
    "#visualize\n",
    "corrplot(cor_matrix, method = \"number\", type = \"upper\")"
   ]
  },
