   "source": [
    "# Insights and Recommendations\n",
    "\n",
    "**Average Steps By Weekends**\n",
    "\n",
    "* Users are most active on Saturday **(24%)** and least active on Sunday **(16%)**, with weekdays averaging **20%** of weekly steps each.\n",
    "\n",
    "**Sleep Efficiency Distribution**\n",
    "\n",
    "* Around **75-80%** of users have high sleep efficiency, while **15%** are medium, and **5-10%** fall into low efficiency. \n",
    "\n",
    "**SedentaryMinutes vs TotalSteps**\n",
    "\n",
    "* Users with high sedentary minutes (up to 20,000+) still reach high total steps, showing inconsistent activity patterns.\n",
    "\n",
    "**RECOMMENDATIONS**\n",
    " 1. Promote Leaf as a daily movement motivator. Add smart reminders for users to hit small step milestones on slow days.\n",
    " 2. Introduce or emphasize inactivity alerts to reduce long sedentary periods and promote balanced movement.\n",
    " 3. Use targeted campaigns around sleep coaching and mindfulness, encouraging users to use Lead to improve sleep consistency.\n",
    " 4. Capitalize on user momentum by launching weekend challenges in the app to encourage forming routines. \n"
   ]
